-- Insert all temp files into THE.OPENING_ATTACHMENT for every existing OPENING_ID
-- Use randomized revision count, timestamps, and user ID
INSERT INTO
  THE.OPENING_ATTACHMENT (
    OPENING_ATTACHMENT_FILE_ID,
    OPENING_ID,
    ATTACHMENT_NAME,
    ATTACHMENT_DESCRIPTION,
    MIME_TYPE_CODE,
    ATTACHMENT_DATA,
    ENTRY_USERID,
    ENTRY_TIMESTAMP,
    UPDATE_USERID,
    UPDATE_TIMESTAMP,
    REVISION_COUNT,
    OPENING_ATTACHMENT_GUID
  )
SELECT
  OPENING_ATTACHMENT_SEQ.NEXTVAL,
  o.OPENING_ID,
  t.ATTACHMENT_NAME,
  t.ATTACHMENT_DESCRIPTION,
  t.MIME_TYPE_CODE,
  t.ATTACHMENT_DATA,
  'IDIR/' || hp_name.NAME,
  SYSDATE - DBMS_RANDOM.VALUE(30, 730),
  -- 1 to 24 months ago
  'IDIR/' || hp_name.NAME,
  SYSDATE - DBMS_RANDOM.VALUE(30, 730),
  TRUNC(DBMS_RANDOM.VALUE(1, 11)),
  SYS_GUID()
FROM
  TEMP_ATTACHMENT_FILE t
  CROSS JOIN THE.OPENING o
  CROSS JOIN (
    SELECT
      COLUMN_VALUE AS NAME
    FROM
      TABLE(
        SYS.ODCIVARCHAR2LIST(
          'DOBBY',
          'SNAPE',
          'HEDWIG',
          'TONKS',
          'LUPIN',
          'MOLLY',
          'SIRIUS',
          'HAGRID'
        )
      )
    ORDER BY
      DBMS_RANDOM.VALUE
    FETCH FIRST
      1 ROWS ONLY
  ) hp_name;

DROP TABLE TEMP_ATTACHMENT_FILE;
